import {
  Routes,
  Route,
  useNavigationType,
  useLocation,
} from "react-router-dom";
import Pop from "./pages/Pop";
import Facts from "./pages/Facts";
import Inter from "./pages/Inter";
import Left from "./pages/Left";
import Hot from "./pages/Hot";
import History1 from "./pages/History1";
import Main from "./pages/Main";
import Right from "./pages/Right";
import FaSolidfire from "./pages/FaSolidfire";
import CardBest from "./pages/CardBest";
import CardBest1 from "./pages/CardBest1";
import CardBest2 from "./pages/CardBest2";
import Gray from "./pages/Gray";
import Know from "./pages/Know";
import How from "./pages/How";
import Pink from "./pages/Pink";
import Nav from "./pages/Nav";
import { useEffect } from "react";

function App() {
  const action = useNavigationType();
  const location = useLocation();
  const pathname = location.pathname;

  useEffect(() => {
    if (action !== "POP") {
      window.scrollTo(0, 0);
    }
  }, [action, pathname]);

  useEffect(() => {
    let title = "";
    let metaDescription = "";

    switch (pathname) {
      case "/":
        title = "";
        metaDescription = "";
        break;
      case "/facts":
        title = "";
        metaDescription = "";
        break;
      case "/inter":
        title = "";
        metaDescription = "";
        break;
      case "/left":
        title = "";
        metaDescription = "";
        break;
      case "/hot":
        title = "";
        metaDescription = "";
        break;
      case "/history":
        title = "";
        metaDescription = "";
        break;
      case "/main":
        title = "";
        metaDescription = "";
        break;
      case "/right":
        title = "";
        metaDescription = "";
        break;
      case "/fasolidfire":
        title = "";
        metaDescription = "";
        break;
      case "/card-best":
        title = "";
        metaDescription = "";
        break;
      case "/card-best1":
        title = "";
        metaDescription = "";
        break;
      case "/card-best2":
        title = "";
        metaDescription = "";
        break;
      case "/gray":
        title = "";
        metaDescription = "";
        break;
      case "/know":
        title = "";
        metaDescription = "";
        break;
      case "/how":
        title = "";
        metaDescription = "";
        break;
      case "/pink":
        title = "";
        metaDescription = "";
        break;
      case "/nav":
        title = "";
        metaDescription = "";
        break;
    }

    if (title) {
      document.title = title;
    }

    if (metaDescription) {
      const metaDescriptionTag = document.querySelector(
        'head > meta[name="description"]'
      );
      if (metaDescriptionTag) {
        metaDescriptionTag.content = metaDescription;
      }
    }
  }, [pathname]);

  return (
    <Routes>
      <Route path="/" element={<Pop />} />
      <Route path="/facts" element={<Facts />} />
      <Route path="/inter" element={<Inter />} />
      <Route path="/left" element={<Left />} />
      <Route path="/hot" element={<Hot />} />
      <Route path="/history" element={<History1 />} />
      <Route path="/main" element={<Main />} />
      <Route path="/right" element={<Right />} />
      <Route path="/fasolidfire" element={<FaSolidfire />} />
      <Route path="/card-best" element={<CardBest />} />
      <Route path="/card-best1" element={<CardBest1 />} />
      <Route path="/card-best2" element={<CardBest2 />} />
      <Route path="/gray" element={<Gray />} />
      <Route path="/know" element={<Know />} />
      <Route path="/how" element={<How />} />
      <Route path="/pink" element={<Pink />} />
      <Route path="/nav" element={<Nav />} />
    </Routes>
  );
}
export default App;
